import React from 'react';
import { Link } from 'react-router-dom';
import 'admin-lte/dist/css/adminlte.min.css';
import '@fortawesome/fontawesome-free/css/all.min.css';

function Header({ sessionName, sessionPhoto }) {
  return (
    <header className="main-header">
  {/*=====================================
	LOGOTIPO
	======================================*/}
  <a href="inicio" className="logo" style={{paddingBottom: '6%', backgroundColor: '#000000', borderBottom: '2px solid #e3aa00'}}>
    {/* logo mini */}
    <span className="logo-mini" style={{paddingBottom: '0%'}}>
      <img src="vistas/img/plantilla/logo11.png" className="img-responsive" style={{padding: 8, marginTop: '15%'}} />
    </span>
    {/* logo normal */}
    <span className="logo-lg" style={{paddingBottom: '6%'}}>
      <img src="vistas/img/plantilla/logo_final_2.png" style={{display: 'block', maxWidth: '88%', height: 'auto', marginTop: '1%'}} />
    </span>
  </a>
  {/*=====================================
	BARRA DE NAVEGACIÓN
	======================================*/}
  <nav className="navbar navbar-static-top" role="navigation" style={{backgroundColor: '#000000', borderBottom: '2px solid #e3aa00', borderLeft: '2px solid #e3aa00'}}>
    {/* Botón de navegación */}
    <a href="#" className="sidebar-toggle" data-toggle="push-menu" role="button">
      <span className="sr-only">Toggle navigation</span>
    </a>
    {/* perfil de usuario */}
    <div className="navbar-custom-menu">
      <ul className="nav navbar-nav">
        <li className="dropdown user user-menu">
          <a href="#" className="dropdown-toggle" data-toggle="dropdown" style={{marginTop: '10%', zoom: '113%'}}>
            {/*?php

					if($_SESSION["foto"] != ""){

						echo '<img src="'.$_SESSION["foto"].'" class="user-image"*/}';
            {'}'}else{'{'}
            echo '<img src="vistas/img/usuarios/default/anonymous.png" className="user-image" />';
            {'}'}
            ?&gt;
            <span className="hidden-xs">{/*?php  echo $_SESSION["nombre"]; ?*/}</span>
          </a>
          {/* Dropdown-toggle */}
          <ul className="dropdown-menu">
            <li className="user-body">
              <div className="pull-right">
                <a href="salir" className="btn btn-default btn-flat">Salir</a>
              </div>
            </li>
          </ul>
        </li>
      </ul>
    </div>
  </nav>
</header>


  );
}

export default Header;
